webpackJsonp([0x8303fe4bd7f3],{688:function(a,e){a.exports={data:{markdownRemark:{html:'<p>Need to learn the basics of hacking? HackerOne offers Hacker101 - a free online course about web security. The course is taught through video lessons where you don\'t have to go through the course in order, but you can simply watch the lessons on the topics that you want to learn about.</p>\n<p>The course offers a range of topics you can learn about. They range from writing reports, setting up Burp proxy, cookie security, to clickjacking and crypto attacks. Go to <a href="https://www.hacker101.com/">https://www.hacker101.com/</a> to access all the course material.</p>\n<p>You can view the FAQ list at <a href="https://www.hackerone.com/hacker101">https://www.hackerone.com/hacker101</a> or email hacker101@hackerone.com with questions or comments.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-bbe55.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 73.5813953488372%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hacker101"\n        title=""\n        src="/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-2f183.png"\n        srcset="/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-67829.png 125w,\n/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-5c59f.png 250w,\n/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-2f183.png 500w,\n/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-c93e8.png 750w,\n/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-4e628.png 1000w,\n/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-b3ac4.png 1500w,\n/static/hacker101-1-fd3822ba07ba51cd69c19dfecae94608-bbe55.png 2150w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h3>Hacker101 CTF</h3>\n<p>Hacker 101 also offers a Capture The Flag (CTF) game where you can hack and hunt for bugs in a safe environment. The CTF serves as the official coursework for the class. You can still access the old coursework on the <a href="https://github.com/Hacker0x01/Hacker101Coursework">github repo</a>.</p>\n<p>Every time you earn 26 points in the CTF, you’ll be put in the priority queue to receive invitations to private programs. Once you receive and accept an invitation to a private program, you’ll be taken out of the priority queue until you earn another 26 points to be put back in the queue.  </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-7a8b1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 18.250000000000004%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hacker101 CTF"\n        title=""\n        src="/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-2f183.png"\n        srcset="/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-67829.png 125w,\n/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-5c59f.png 250w,\n/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-2f183.png 500w,\n/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-c93e8.png 750w,\n/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-4e628.png 1000w,\n/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-b3ac4.png 1500w,\n/static/hacker101-2-33fd5b43c3e539b06de3a59545f4baf2-7a8b1.png 1600w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>To get started on the Hacker101 CTF:</p>\n<ol>\n<li>Log in with your HackerOne account. <i>Note: You need to have a HackerOne account to log in to the Hacker101 CTF. If you don’t have a HackerOne account, click Log in and you can get started with creating one.</i></li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker101-3-cd73f2b72f498d85e72afe844227a6bc-06af1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 76.260162601626%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hacker101 CTF login page"\n        title=""\n        src="/static/hacker101-3-cd73f2b72f498d85e72afe844227a6bc-2f183.png"\n        srcset="/static/hacker101-3-cd73f2b72f498d85e72afe844227a6bc-67829.png 125w,\n/static/hacker101-3-cd73f2b72f498d85e72afe844227a6bc-5c59f.png 250w,\n/static/hacker101-3-cd73f2b72f498d85e72afe844227a6bc-2f183.png 500w,\n/static/hacker101-3-cd73f2b72f498d85e72afe844227a6bc-c93e8.png 750w,\n/static/hacker101-3-cd73f2b72f498d85e72afe844227a6bc-4e628.png 1000w,\n/static/hacker101-3-cd73f2b72f498d85e72afe844227a6bc-06af1.png 1230w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="2">\n<li>Authorize Hacker101 CTF to access your HackerOne public profile and flags.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker101-4-a0f781e1cfcc3b240d328d6b901d2e6c-fb33c.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 51.71790235081375%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hacker101 CTF authorization window"\n        title=""\n        src="/static/hacker101-4-a0f781e1cfcc3b240d328d6b901d2e6c-2f183.png"\n        srcset="/static/hacker101-4-a0f781e1cfcc3b240d328d6b901d2e6c-67829.png 125w,\n/static/hacker101-4-a0f781e1cfcc3b240d328d6b901d2e6c-5c59f.png 250w,\n/static/hacker101-4-a0f781e1cfcc3b240d328d6b901d2e6c-2f183.png 500w,\n/static/hacker101-4-a0f781e1cfcc3b240d328d6b901d2e6c-c93e8.png 750w,\n/static/hacker101-4-a0f781e1cfcc3b240d328d6b901d2e6c-4e628.png 1000w,\n/static/hacker101-4-a0f781e1cfcc3b240d328d6b901d2e6c-fb33c.png 1106w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="3">\n<li>Select the difficulty of the level that you want to find flags for.</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-7a8b1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 48.6875%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hacker101 CTF homepage"\n        title=""\n        src="/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-2f183.png"\n        srcset="/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-67829.png 125w,\n/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-5c59f.png 250w,\n/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-2f183.png 500w,\n/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-c93e8.png 750w,\n/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-4e628.png 1000w,\n/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-b3ac4.png 1500w,\n/static/hacker101-5-7fb10ab59a3437e34f2595c5d23642d9-7a8b1.png 1600w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<ol start="4">\n<li>Click <b>Go</b> to start capturing flags.</li>\n</ol>\n<p>If you get stuck, you can select <b>Hints</b> to receive a hint. Keep in mind that most levels have a total of 3-5 hints, and hints can only be accessed on an increasing timer, as the time before accessing each subsequent hint increases.</p>\n<p>Click <b>Restart</b> if your instance is bugging out or running slow. You won’t lose any of your captured flags for clicking Restart.</p>\n<h4>Groups</h4>\n<p>You can also create your own group and invite others to join your group, through which you can manage individuals and their progress in working through the CTF.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-1f553.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 26.17534942820839%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAAFCAIAAADKYVtkAAAACXBIWXMAAAsSAAALEgHS3X78AAAAjUlEQVQY05WOWQ7DMAhEff8Lpm2WMwQbg+2wlLpSPyP1CcGABEwiouXxXLf9tW4i4v+QWmvHfiyTUgoi5kmZwFcgAsBviLVGF5+SqJ14IUsmRepj9DgXdiL3qaMGzO0TsxljMLOqJlXDprV7Jmk9TrmYq1lkUTe7ta1yQe3ADjksI5Cf1cJIYQtB/W77DQJdItjDIPpDAAAAAElFTkSuQmCC\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="hacker101 CTF groups"\n        title=""\n        src="/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-2f183.png"\n        srcset="/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-67829.png 125w,\n/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-5c59f.png 250w,\n/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-2f183.png 500w,\n/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-c93e8.png 750w,\n/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-4e628.png 1000w,\n/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-b3ac4.png 1500w,\n/static/hacker101-6-3a9795552ac8fc221141093833e4e4d1-1f553.png 1574w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-7a8b1.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 25.8125%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="create a group"\n        title=""\n        src="/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-2f183.png"\n        srcset="/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-67829.png 125w,\n/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-5c59f.png 250w,\n/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-2f183.png 500w,\n/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-c93e8.png 750w,\n/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-4e628.png 1000w,\n/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-b3ac4.png 1500w,\n/static/hacker101-7-45b937aa2a291820180a87504a6cfdef-7a8b1.png 1600w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Learn more about <a href="https://ctf.hacker101.com/">Hacker101 CTF</a></p>',frontmatter:{title:"Hacker101",id:"hackers/hacker101",path:"/hackers/hacker101.html",description:null}}},pathContext:{}}}});
